"use client";

import { useRef, useState } from "react";
import toast from 'react-hot-toast';
import Loader from '../loader/Loader';
import getCurrentTime from '@/utils/getCorrentTime';
import IconOptions from '../options/IconOptions';
import IOSOption from '../options/IOSOption';
import getPicture from '@/utils/getPicture';
import Image from "next/image";
import { RobotoBaseEncoded } from "@/utils/encodedFonts/RobotoBaseEncoded";

const View8 = () => {

    const screenshotRef = useRef(null);
    const [isLoading, setIsLoading] = useState(false);
    const pageName = "VIEW 8";

    const [data, setData] = useState({
        address: "TPBcJiDr2Zn9CqP4FnKsf186VEWPbw",
        address1: "Ujrv",
    });

    const onChangeHandler = (e) => {
        setData({ ...data, [e.target.name]: e.target.value });
    }

    const [imageDimension, setImageDimension] = useState("50");

    const [time, setTime] = useState("9:34");
    const [network, setNetwork] = useState(4);
    const [net, setNet] = useState("wifi");
    const [isBattery, setIsBattery] = useState(true);
    const [battery, setBattery] = useState(50);
    const [bgColor, setBgColor] = useState("#ffffff");
    const [isOption, setIsOption] = useState(true);
    const [isIOS, setIsIOS] = useState(true);
    const [preview, setPreview] = useState("");
    const [isPreview, setIsPreview] = useState(false);

    const fetchCurrentTime = async () => {
        const timeValue = await getCurrentTime();
        setTime(timeValue);
    }

    const takeScreenshot = async () => {
        await getPicture(
            setPreview,
            setIsPreview,
            screenshotRef,
            setIsLoading,
            toast,
            0,
            1.2,
            0,
            1.2
        );
    }

    return (
        <>
            {isLoading ? <Loader /> : <></>}
            {
                isPreview
                    ?
                    <>
                        <div className="show_preview" onClick={() => setIsPreview(false)}>
                            <div className="inner_preview" onClick={(e) => e.stopPropagation()}>
                                <Image
                                    src={preview}
                                    height={100}
                                    width={100}
                                    alt="pre"
                                />
                            </div>
                        </div>
                    </>
                    :
                    <>
                    </>
            }
            <div className="bill-inner-view">
                <div className="bill-inner-view-childs">
                    <IconOptions
                        setImageDimension={setImageDimension}
                        setNetwork={setNetwork}
                        setNet={setNet}
                        setIsBattery={setIsBattery}
                        setBattery={setBattery}
                        setBgColor={setBgColor}
                        setIsOption={setIsOption}
                        setTime={setTime}
                        battery={battery}
                        isOption={isOption}
                        time={time}
                        bgColor={bgColor}
                        imageDimension={imageDimension}
                        fetchCurrentTime={fetchCurrentTime}
                        setIsIOS={setIsIOS}
                        isIOS={isIOS}
                    />
                    <div className="billing-mobile-wrapper" style={{
                        background: `${bgColor}`
                    }}>
                        <div
                            className="artboard"
                            ref={screenshotRef}
                            style={{
                                transform: `scale(${imageDimension / 100})`,
                            }}
                        >
                            <svg
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                                viewBox="0 0 432 960"
                            >
                                <style>
                                    {
                                        RobotoBaseEncoded
                                    }
                                </style>
                                <g id="Group_23" data-name="Group 23" transform="translate(-60 -68)">
                                    <image
                                        xlinkHref="data:image/jpeg;base64,"
                                        id="photo_2025-01-31_02-55-44_4_"
                                        width="432"
                                        height="960"
                                        data-name="photo_2025-01-31_02-55-44 (4)"
                                        transform="translate(60 68)"
                                    ></image>
                                    <path
                                        id="Rectangle_20"
                                        fill="#1f2630"
                                        d="M0 0h381v42H0z"
                                        data-name="Rectangle 20"
                                        transform="translate(88 80)"
                                    ></path>
                                    <path
                                        id="Rectangle_21"
                                        fill="#1f2630"
                                        d="M0 0h322v51H0z"
                                        data-name="Rectangle 21"
                                        transform="translate(92 585)"
                                    ></path>
                                    <g
                                        id="Group_22"
                                        fill="#eff2f6"
                                        data-name="Group 22"
                                        fontFamily="Roboto-Medium, Roboto"
                                        fontSize="17"
                                        fontWeight="500"
                                        letterSpacing=".009em"
                                    >
                                        <text
                                            id="TPBcJiDr2Zn9CqP4FnKsf186VEWPbw"
                                            transform="translate(104 605)"
                                        >
                                            <tspan x="0" y="0">
                                                {data.address}
                                            </tspan>
                                        </text>
                                        <text id="Ujrv" transform="translate(104 628)">
                                            <tspan x="0" y="0">
                                                {data.address1}
                                            </tspan>
                                        </text>
                                    </g>
                                    <path
                                        id="Rectangle_22"
                                        fill="#1f2630"
                                        d="M0 0h163v11H0z"
                                        data-name="Rectangle 22"
                                        transform="translate(195 1013)"
                                    ></path>
                                    {
                                        isIOS
                                            ?
                                            <>
                                                <rect
                                                    id="Rectangle_14"
                                                    width="137"
                                                    height="3"
                                                    fill="#fff"
                                                    data-name="Rectangle 14"
                                                    rx="1.5"
                                                    transform="translate(208 1017)"
                                                ></rect>
                                            </>
                                            :
                                            <></>
                                    }

                                </g>
                            </svg>

                            <IOSOption
                                battery={battery}
                                isOption={isOption}
                                time={time}
                                network={network}
                                net={net}
                                isBattery={isBattery}
                                iconPadding={`2rem 5rem 0rem 7rem`}
                                isIOS={isIOS}
                            />
                        </div>
                    </div>
                </div >

                <div className="bill-inner-view-childs">
                    <h4 className="section-heading">INPUTS - {pageName}</h4>
                    <div className="screenshot-btn">
                        <button onClick={() => takeScreenshot()}>Screenshot <i className="fa fa-copy"></i></button>
                    </div>
                    <div className="global_form_wrapper">

                        <div className="global_form_inner">
                            <label>Address</label>
                            <input
                                type="text"
                                value={data.address}
                                name="address"
                                onChange={(e) => onChangeHandler(e)}
                            />
                            <input
                                type="text"
                                value={data.address1}
                                name="address1"
                                onChange={(e) => onChangeHandler(e)}
                            />
                        </div>

                    </div>
                </div>

            </div >
        </>
    )
}

export default View8